b528c1ac-6104-435b-ae62-08eb4f8ef40e	Early Alert Sent to Student	Message sent from system to student when faculty member sends an early alert.	Student $TermToRepresentEarlyAlert Notice - $FirstName> $LastName : $CourseName	<html><body>\n<p>Dear $earlyAlert.person.firstName $earlyAlert.person.lastName</p>\n\n<p>Your instructor for #if( $earlyAlert.courseName )$earlyAlert.courseName#else<COURSE NAME UNAVAILABLE>#end notified me that you are experiencing issues that might affect your success#if( $institutionName ) at $institutionName#end.  An academic advisor, counselor or coach will contact you soon to discuss your situation. In the meantime, here are a few resources which may help you find academic success.</p>\n\n<table><tr><th>Instructor</th><td>$earlyAlert.createdBy.firstName $earlyAlert.createdBy.lastName#if( $earlyAlert.createdBy.workPhone )</td><tr>\n<tr><th>Phone</th><td>$earlyAlert.createdBy.workPhone#end</td><tr>\n<tr><th>Email</th><td>$earlyAlert.createdBy.primaryEmailAddress</td><tr>\n</table>\n\n<p>The Tutoring and Learning Center (Library: 555-4506) provides professional tutoring in the subject areas of English grammar and writing, basic math and study skills. The Center also provides additional quiet computer areas for students, online resources, and supplemental learning materials. Walk-ins are available during open hours. Call for schedule.</p>\n\n<p>Tutorial Services (Library: 555-2792) provides free educational assistance for students who are enrolled in most 100 level courses (including DEV and some 200 level classes). Student tutors provide individual tutoring sessions by appointment.</p>\n\n<p>The Writing Center (Library: 555-5106) provides a comfortable learning environment for classroom instruction and tutorial assistance for writing.</p>\n\n<p>The Math Lab (Building 1, Room 315: 555-2286) provides tutoring and homework help for students in MAT classes. Walk-ins are available during open hours.</p>\n\n<p>COPE is a unique series of workshops designed to help students Conquer some of the Obstacles that can Prevent the achievement of their Educational goals. A schedule of topics is available in 10-424 or online at http://www.studentsuccessplan.org Contact Anthony at 555-2752 for handouts of past or future workshops.</p>\n\n<p>Information on Dropping: Before withdrawing from any or all classes, consult an academic advisor. If you are using financial aid to pay for your tuition or books, contact the Financial Aid & Scholarships Office: Building 10, 3rd Floor, 555 555-3000.</p>\n\n<p>We value you as a student #if( $institutionName ) at $institutionName#end and want to support your success. If you have not been contacted by someone within a week, please feel free to speak with me.</p>\n\n<p>Sincerely,</p>\n\n<p>$earlyAlert.person.coach.firstName $earlyAlert.person.coach.lastName\n<br />$earlyAlert.person.coach.title#if( $earlyAlert.person.coach.staffDetails.officeLocation )\n<br />$earlyAlert.person.coach.officeLocation#end#if( $earlyAlert.person.coach.workPhone )\n<br />$earlyAlert.person.coach.workPhone#end\n<br />$earlyAlert.person.coach.primaryEmailAddress</p>\n\n<p>Email generated by $!institutionName $!applicationTitle $!termToRepresentEarlyAlert</p>\n\n<p>This is a system generated email. Please do not reply to this confirmation.</p>\n</body></html>	2014-05-18 16:00:00	2014-05-22 16:00:00	58ba5ee3-734e-4ae9-b9c5-943774b4de41	58ba5ee3-734e-4ae9-b9c5-943774b4de41	1	\N	\N
b528c1ac-6104-435b-ae62-08eb4f7ee3fc	Early Alert Confirmation to Advisor	Message sent from system to advisor when faculty member sends an alert.	Student#if( $termToRepresentEarlyAlert ) $termToRepresentEarlyAlert#end Notice - $earlyAlert.person.firstName $earlyAlert.person.lastName#if( $earlyAlert.courseName) : $earlyAlert.courseName#end	<html><body>\n<p><b>STUDENT $!termToRepresentEarlyAlert SYSTEM MESSAGE</b></p>\n\n<table>\n<tr><th>Student Name</th><td>$earlyAlert.person.firstName $earlyAlert.person.lastName</td></tr>\n<tr><th>Student ID</th><td>$!earlyAlert.person.schoolId</td></tr>\n<tr><th>Student Phone</th><td>$!earlyAlert.person.homePhone</td></tr>\n<tr><th>Student Email</th><td>$earlyAlert.person.primaryEmailAddress</td></tr>\n<tr><th>Address</th><td>#if( $earlyAlert.person.addressLine1 )$earlyAlert.person.addressLine1, #end#if( $earlyAlert.person.addressLine2 )$earlyAlert.person.addressLine2, #end#if( $earlyAlert.person.city )$earlyAlert.person.city, #end#if( $earlyAlert.person.state )$earlyAlert.person.state, #end$!earlyAlert.person.zipCode</td></tr>\n<tr><th>In the class</th><td>$!earlyAlert.courseName</td></tr>\n<tr><th>Instructor</th><td>$earlyAlert.createdBy.firstName $earlyAlert.createdBy.lastName</td></tr>\n<tr><th>Campus</th><td>$earlyAlert.campus.name</td></tr>\n<tr><th>Instructor Office Location</th><td>$!earlyAlert.createdBy.staffDetails.officeLocation</td></tr>\n<tr><th>Instructor Email</th><td>$earlyAlert.createdBy.primaryEmailAddress</td></tr>\n<tr><th>Instructor Phone</th><td>$!earlyAlert.createdBy.workPhone</td></tr>\n<tr><th>Advisor</th><td>$earlyAlert.person.coach.firstName $earlyAlert.person.coach.lastName</td></tr>\n</table>\n\n<p><b>Student has been identified by his/her instructor for the following reason:</b></p>\n<ul>\n#foreach( $earlyAlertReason in $earlyAlert.earlyAlertReasonIds )\n<li>$earlyAlertReason.name</li>\n#end\n</ul>\n\n<p><b>The faculty suggestions are:</b></p>\n<ul>\n#foreach( $earlyAlertSuggestion in $earlyAlert.earlyAlertSuggestionIds )\n<li>$earlyAlertSuggestion.name</li>\n#end\n</ul>\n\n#if( $earlyAlert.comment )\n<p>\n******************* INSTRUCTOR COMMENTS *******************\n<br />\n$earlyAlert.comment\n<br />\n******************* INSTRUCTOR COMMENTS *******************\n<p>\n#end\n\n<p>To access additional information or respond to this alert, log-in#if( $applicationTitle ) to $applicationTitle#end#if( $termForEarlyAlert ) and view the student&apos;s $termForEarlyAlert Tool#end.  $!linkToSSP </p>\n\n<p>Email generated by $!applicationTitle $!termForEarlyAlert</p>\n</body></html>	2014-05-18 16:00:00	2014-05-22 16:00:00	58ba5ee3-734e-4ae9-b9c5-943774b4de41	58ba5ee3-734e-4ae9-b9c5-943774b4de41	1	\N	\N
b528c1ac-6104-435b-ae62-09fb5f9ef680	Early Alert Response to Faculty from Coach	Message sent to faculty member (creator of the alert) when the Advisor responds via SSP.	Student$!termToRepresentEarlyAlert Advisor Reply - $earlyAlert.person.firstName $earlyAlert.person.lastName #if( $earlyAlert.courseName) : $earlyAlert.courseName#end	<html><body>\n<p><b>STUDENT $!termToRepresentEarlyAlert SYSTEM MESSAGE</b></p>\n\n<p>This email is in response to an early alert notice initiated on $earlyAlert.createdDate for the following student:</p>\n\n<table>\n<tr><th>Student Name</th><td>$earlyAlert.person.firstName $earlyAlert.person.lastName</td></tr>\n<tr><th>Student ID</th><td>$!earlyAlert.person.schoolId</td></tr>\n<tr><th>In the class</th><td>$!earlyAlert.courseName</td></tr>\n<tr><th>Instructor</th><td>$earlyAlert.createdBy.firstName $earlyAlert.createdBy.lastName</td></tr>\n<tr><th>Advisor(s)</th><td>$earlyAlert.person.coach.firstName $earlyAlert.person.coach.lastName</td></tr>\n</table>\n\n#if( $earlyAlert.closedDate )\n<p>This incident was addressed and CLOSED on $earlyAlert.closedDate. The final outcome for this incident was:</p>\n#else\n<p>This incident was addressed on $earlyAlertResponse.modifiedDate. The outcome was:</p>\n#end\n\n<p>$!earlyAlertResponse.earlyAlertOutcome.name</p>\n\n#if( $earlyAlertResponse.earlyAlertOutcomeOtherDescription )\n<p>$earlyAlertResponse.earlyAlertOutcomeOtherDescription</p>\n#end\n\n<p>The student has been referred by his/her counselor to the following departments or services based upon early alert status:</p>\n<ul>\n#foreach( $earlyAlertReferral in $earlyAlertResponse.earlyAlertReferralIds )\n<li>$earlyAlertReferral.name</li>\n#end\n</ul>\n\n#if( $earlyAlertResponse.comment )\n<p>******************* INSTRUCTOR COMMENTS *******************\n<br />\n$earlyAlertResponse.comment\n<br />\n******************* INSTRUCTOR COMMENTS *******************</p>\n#end\n\n<p>Email generated by $!institutionName $!applicationTitle $!termToRepresentEarlyAlert</p>\n</body></html>	2014-05-18 16:00:00	2015-02-15 00:00:00	58ba5ee3-734e-4ae9-b9c5-943774b4de41	58ba5ee3-734e-4ae9-b9c5-943774b4de41	1	\N	\N
5d183f35-023d-40ea-b8d9-66fbe190fffb	Action Plan Email	Action Plan Email	Action plan for ${fullName}	<html>\n<body>Dear ${fullName},<br/>\n<br/>\nAs a result of completing the self help guide questionnaire(s) you have \nidentified the following resource information as being imperative to your \nsuccess.&nbsp;&nbsp;Below you will find the solutions you felt offered the best \npath to your success.<br/>\n<br/>\n<br/>\n#foreach($taskTO in $taskTOs)<b>Resource:</b>&nbsp;${taskTO.name}<br/><b>Description:</b>&nbsp;${taskTO.description}<br/><br/>#end <br/>\n#foreach($goalTO in $goalTOs)<b>Resource:</b>&nbsp;${goalTO.name}<br/><b>Description:</b>&nbsp;${goalTO.description}<br/><br/>#end <br/>\nShould you have any questions concerning the resource information listed please contact the resource in question or the counseling staff at your institution.<br/>\n<br/>\nThank you.</body></html>	2014-05-17 10:00:00	2014-06-28 18:00:00	58ba5ee3-734e-4ae9-b9c5-943774b4de41	58ba5ee3-734e-4ae9-b9c5-943774b4de41	1	\N	\N
9d3ce5b1-e27d-40c8-8f45-abcb1bccf3b0	New Student Intake Task Email	New Student Intake Task Email	Student Intake Form Request	<html><body><p>Hello ${fullName}!</p><p>Your Coach or Advisor has asked that you complete a Task online, the Student Intake form.  ${description}  The form is a series of questions that should only take a few minutes to complete.  The information collected will assist us in providing you with the best services and advice that we can.</p> <p>Please login with your college username and password at the following URL:  <a href="https://www.studentsuccessplan.org">https://www.studentsuccessplan.org</a></p><p>The Student Intake link will appear in the Task list on the right side of the screen.</p><p>Please complete this task by ${dueDateFormatted}</p><p>Thank you for your time and cooperation.  We look forward to providing you great service!</p><p>-College Team</p><p>If you have questions, please contact your Coach or Advisor directly. This is an automated message, please do not use the reply option.</p></body></html>	2014-05-17 10:00:00	2014-05-17 10:00:00	58ba5ee3-734e-4ae9-b9c5-943774b4de41	58ba5ee3-734e-4ae9-b9c5-943774b4de41	1	\N	\N
b528c1ac-6104-435b-ae62-09eb5f8ef55f	Early Alert Confirmation to Faculty	Message sent from system to faculty member when faculty member sends an alert.	Student$!termToRepresentEarlyAlert Confirmation Notice - $earlyAlert.person.firstName $earlyAlert.person.lastName #if( $earlyAlert.courseName) : $earlyAlert.courseName#end	<html><body>\n<p><b>STUDENT $!termToRepresentEarlyAlert SYSTEM MESSAGE</b></p>\n<table>\n<tr><th>Student Name</th><td>$earlyAlert.person.firstName $earlyAlert.person.lastName</td></tr>\n<tr><th>Student ID</th><td>$!earlyAlert.person.schoolId</td></tr>\n<tr><th>Student Phone</th><td>$!earlyAlert.person.homePhone</td></tr>\n<tr><th>Student Email</th><td>$earlyAlert.person.primaryEmailAddress</td></tr>\n<tr><th>Address</th><td>#if( $earlyAlert.person.addressLine1 )$earlyAlert.person.addressLine1, #end#if( $earlyAlert.person.addressLine2 )$earlyAlert.person.addressLine2, #end#if( $earlyAlert.person.city )$earlyAlert.person.city, #end#if( $earlyAlert.person.state )$earlyAlert.person.state, #end$!earlyAlert.person.zipCode</td></tr>\n<tr><th>In the class</th><td>$!earlyAlert.courseName</td></tr>\n<tr><th>Instructor</th><td>$earlyAlert.createdBy.firstName $earlyAlert.createdBy.lastName</td></tr>\n<tr><th>Campus</th><td>$!earlyAlert.campus.name</td></tr>\n<tr><th>Instructor Office Location</th><td>$!earlyAlert.createdBy.staffDetails.officeLocation</td></tr>\n<tr><th>Instructor Email</th><td>$earlyAlert.createdBy.primaryEmailAddress</td></tr>\n<tr><th>Instructor Phone</th><td>$!earlyAlert.createdBy.workPhone</td></tr>\n<tr><th>Advisor</th><td>$earlyAlert.person.coach.firstName $earlyAlert.person.coach.lastName</td></tr>\n</table>\n<p>Student has been identified by his/her instructor for the following reason:</ul>\n\n<ul>\n#foreach( $earlyAlertReason in $earlyAlert.earlyAlertReasonIds )\n<li>$earlyAlertReason.name</li>\n#end\n</ul>\n\n<p><b>The faculty suggestions are</b></p>\n<ul>\n#foreach( $earlyAlertSuggestion in $earlyAlert.earlyAlertSuggestionIds )\n<li