COPY up_permission_activity (activity_id, activity_description, entity_version, activity_fname, activity_name, owner_target_provider, owner_id) FROM stdin;
1	Receive *any* portal permission.  This permission covers all \n        permissions for all systems, is not blockable, and is only intended\n        to be granted to superusers.	0	ALL_PERMISSIONS	Superuser	portalSystemTargetProvider	1
2	Manage expired uPortal content.  This permission also implies the ability to create, approve, and publish portlets.	0	MANAGE_EXPIRED	Manage Expired	channelsAndCategoriesTargetProvider	2
3	Access the configuration mode of a portlet.	0	PORTLET_MODE_CONFIG	Configure	channelsAndCategoriesTargetProvider	2
4	Manage approved uPortal content.  This permission also implies the ability to create portlets.	0	MANAGE_APPROVED	Manage Approved	channelsAndCategoriesTargetProvider	2
5	Create uPortal content.	0	MANAGE_CREATED	Manage Created	channelsAndCategoriesTargetProvider	2
6	Manage published uPortal content.  This permission also implies the ability to create and approve portlets.	0	MANAGE	Manage Published	channelsAndCategoriesTargetProvider	2
7		0	VIEW	View	errorChannelTargetProvider	3
8	Subscribe to uPortal content that has not yet been approved or published	0	SUBSCRIBE_CREATED	Subscribe Created	channelsAndCategoriesTargetProvider	4
9	Subscribe to uPortal content that is approved, but not yet published	0	SUBSCRIBE_APPROVED	Subscribe Approved	channelsAndCategoriesTargetProvider	4
