--
-- Name: get_early_alert_response_due_count(date, uuid); Type: FUNCTION; Schema: public; Owner: sspadmin
--

CREATE FUNCTION get_early_alert_response_due_count(date, uuid) RETURNS bigint
    LANGUAGE sql STRICT
    AS $_$
                  select distinct count(*) from public.early_alert as ea
                  where
                      ea.person_id = $2 and
                      ea.closed_date is null and
                      ea.object_status = 1 and
                      (
                        (LAST_EARLY_ALERT_RESPONSE_DATE(ea.id) is null and ea.created_date < $1)
                        or
                        (LAST_EARLY_ALERT_RESPONSE_DATE(ea.id) < $1)
                      )
              $_$;


