-- Name: v_directory_person; Type: VIEW; Schema: public; Owner: sspadmin
--

CREATE VIEW v_directory_person AS
    SELECT COALESCE(p.school_id, ep.school_id) AS id, p.id AS person_id, COALESCE(p.school_id, ep.school_id) AS school_id, COALESCE(p.username, ep.username) AS username, COALESCE(p.first_name, ep.first_name) AS first_name, COALESCE(p.middle_name, ep.middle_name) AS middle_name, COALESCE(p.last_name, ep.last_name) AS last_name, COALESCE(p.birth_date, ep.birth_date) AS birth_date, COALESCE(p.primary_email_address, ep.primary_email_address) AS primary_email_address, COALESCE(p.address_line_1, ep.address_line_1) AS address_line_1, COALESCE(p.address_line_2, ep.address_line_2) AS address_line_2, COALESCE(p.city, ep.city) AS city, COALESCE(p.state, ep.state) AS state, COALESCE(p.zip_code, (ep.zip_code)::bpchar) AS zip_code, COALESCE(p.home_phone, ep.home_phone) AS home_phone, COALESCE(p.work_phone, ep.work_phone) AS work_phone, COALESCE(p.actual_start_term, ep.actual_start_term) AS actual_start_term, COALESCE(p.actual_start_year, ep.actual_start_year) AS actual_start_year, COALESCE(p.cell_phone, ep.cell_phone) AS cell_phone, COALESCE(p.photo_url, ep.photo_url) AS photo_url, COALESCE(p.residency_county, ep.residency_county) AS residency_county, COALESCE(p.f1_status, ep.f1_status) AS f1_status, COALESCE(p.coach_id, get_person_id_from_school_id(ep.coach_school_id)) AS coach_id, get_person_first_name_from_id(COALESCE(p.coach_id, get_person_id_from_school_id(ep.coach_school_id))) AS coach_first_name, get_person_last_name_from_id(COALESCE(p.coach_id, get_person_id_from_school_id(ep.coach_school_id))) AS coach_last_name, get_student_type_name_from_id(COALESCE(p.student_type_id, get_student_type_id_from_code(ep.student_type_code))) AS student_type_name, p.student_intake_complete_date, get_program_status_name_from_id(get_program_status_from_person_id(p.id)) AS program_status_name, est.credit_hours_earned, esfa.sap_status_code, est.grade_point_average, active_early_alert_formula(p.id) AS active_alerts_count, inactive_early_alert_formula(p.id) AS closed_alerts_count, get_early_alert_response_due_count(get_early_alert_response_date(), p.id) AS early_alert_response_due_count, get_early_alert_response_current_count(get_early_alert_response_date(), p.id) AS early_alert_response_current_count, current_registration_status(ep.school_id, current_term_code()) AS current_registration_status, p.object_status, est.local_gpa, est.program_gpa FROM ((((external_person ep FULL JOIN person p ON (((ep.school_id)::text = (p.school_id)::text))) LEFT JOIN external_student_transcript est ON (((ep.school_id)::text = (est.school_id)::text))) LEFT JOIN external_student_financial_aid esfa ON (((ep.school_id)::text = (esfa.school_id)::text))) LEFT JOIN external_person_planning_status esps ON (((ep.school_id)::text = (esps.school_id)::text)));


